import React from "react"
import Deck from "./Deck/Deck";
import Mixer from "./Mixer/Mixer";

import "./console.scss";

const Console = props =>{


    return (
        <div className="dj-truck-console">
            <Deck name="A">A</Deck>
            <Mixer />
            <Deck name="B">B</Deck>
        </div>
    )
}


export default Console;
